import React from 'react';
import ReactDOM from 'react-dom';
import Home from './component/home';
import { BrowserRouter as Router, Routes, Route, BrowserRouter } from 'react-router-dom';

const App = () => {
  return (
    <BrowserRouter>

      <Routes>
        <Route path="/home" element={<Home />} />

      </Routes>

    </BrowserRouter>
  );
};

export default App;
